import React, { Component } from "react";
import axios from "axios";

class Silkum extends Component {
  componentDidMount() {}

  List() {
    axios
      .get("http://seeho.kro.kr:3010/json")
      .then(function(res) {
        res.data.map((data, i) =>{
            console.log(data);
            return (
                <>
                hi. List {i}. {data}
                </>
            )
        })
      })
      .catch(function(err) {
        console.log(err);
      });
  }
  render() {
    console.log("ㅇ");
    return (
      <>
        {console.log("dd")}
        {this.List()}
        {console.log("dd1")}
      </>
    );
  }
}

export default Silkum;
